import { Box, LinearProgress, Typography } from "@mui/material";
import { styled } from "@mui/system";
import React, { useContext, useEffect, useState } from "react";
import MyLogin from "./MyLogin";
import { DataBorneContext } from "./ContextBorne";

function AppBorneMulhouse1() {
  const {
    dataBorne,
    setDataBorne,
    progressBar,
    setprogressBar,
    loginEtat,
    setLoginEtat,
  } = useContext(DataBorneContext);

  const MyBox = styled(Box)({
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  });

  function borneAvailable() {
    let e;
    if (dataBorne.propriety.available === true) {
      e = (
        <Typography variant="h3" sx={{ color: "green" }}>
          Disponible
        </Typography>
      );
    }
    if (dataBorne.propriety.available === false) {
      e = (
        <Typography variant="h3" sx={{ color: "red" }}>
          Indisponible
        </Typography>
      );
    }
    return e;
  }
  function showEtat() {
    let el = (
      <MyBox>
        <Typography>Ini </Typography>
      </MyBox>
    );
    console.log("0");
    console.log(loginEtat);
    if (loginEtat) {
      console.log("1");
      el = <MyLogin />;
    } else {
      console.log("2");
      el = (
        <MyBox>
          <Typography>Coucou Ã§a marche ? </Typography>
        </MyBox>
      );
    }
    return el;
  }
  useEffect(() => {
    showEtat();
  }, [loginEtat]);

  return (
    <>
      <MyBox>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </MyBox>

      <MyBox>{borneAvailable()}</MyBox>
      <MyBox>
        <LinearProgress
          variant="determinate"
          sx={{
            m: 2,
            width: "50%",
            height: 10,
            borderRadius: 5,
          }}
          value={progressBar}
        />
      </MyBox>
      <MyBox>
        {console.log(loginEtat)}
        {showEtat()}
        {console.log(loginEtat)}
      </MyBox>
    </>
  );
}

export default AppBorneMulhouse1;
